jQuery(window).load(function(){

	/* --------- Latest Project Item Filter ---------*/

	var $container = jQuery('.project-items'),
	colWidth = function () {
		var w = $container.width(), 
		columnNum = 1,
		columnWidth = 0;
		if (w > 1024) {
			columnNum  = 4;
		} 
		else if (w > 960) {
			columnNum  = 3;
		} 
		else if (w > 640) {
			columnNum  = 2;
		}  
		else if (w > 360) {
			columnNum  = 1;
		} 
		columnWidth = Math.floor(w/columnNum);
		$container.find('.item').each(function() {
			var $item = jQuery(this),
			multiplier_w = $item.attr('class').match(/item-w(\d)/),
			multiplier_h = $item.attr('class').match(/item-h(\d)/),
			width = multiplier_w ? columnWidth*multiplier_w[1] : columnWidth,
			height = multiplier_h ? columnWidth*multiplier_h[1]*0.75-10 : columnWidth*0.69-10;
			$item.css({
				width: width,
				height: height
			});
		});
		return columnWidth;
	},
	isotope = function () {
		$container.isotope({
			resizable: true,
			itemSelector: '.item',
			masonry: {
				columnWidth: colWidth(),
				gutterWidth: 10
			}
		});
	};
	isotope();
	jQuery(window).smartresize(isotope);

	jQuery('.itemFilter a').click(function(){
		jQuery('.itemFilter .current').removeClass('current');
		jQuery(this).addClass('current');

		var selector = jQuery(this).attr('data-filter');
		$container.isotope({
			filter: selector,
			animationOptions: {
				duration: 750,
				easing: 'linear',
				queue: false
			}
		});
		return false;
	}); 



});


